`},{exerciseNumber:3,exerciseName:"Exercise 3: Polling with useEffect",exerciseDescription:"Implement polling of data at regular intervals using useEffect.",exerciseTasks:["Set up useEffect to fetch data at regular intervals","Use setInterval inside useEffect","Clear the interval when the component unmounts","Display the updated data"],workingCode:`
function PollingData() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    const fetchData = () => {
      fetch('https://jsonplaceholder.typicode.com/posts')
        .then(response => response.json())
        .then(json => setData(json));
    };

    fetchData(); // Initial fetch
    const interval = setInterval(fetchData, 5000); // Fetch every 5 seconds

    return () => clearInterval(interval); // Cleanup on unmount
  }, []);

  return (
    <div>
      {data ? (
        <ul>
          {data.map(post => (
            <li key={post.id}>
              <strong>{post.title}</strong>: {post.body}
            </li>
          ))}
        </ul>
      ) : (
        'Fetching data...'
      )}
    </div>
  );
}

render(<PollingData />);
