`},{exerciseNumber:3,exerciseName:"Exercise 3: Exposing Multiple Methods",exerciseDescription:"Use useImperativeHandle to expose multiple methods from a child component.",exerciseTasks:["Create a VideoPlayer component that renders a video element","Use useImperativeHandle to expose 'play', 'pause', and 'toggleFullscreen' methods","Parent component uses a ref to control the video playback","Add buttons in the parent component to test each method"],workingCode:`
function VideoPlayer(props, ref) {
  const videoRef = React.useRef();

  React.useImperativeHandle(ref, () => ({
    play: () => {
      videoRef.current.play();
    },
    pause: () => {
      videoRef.current.pause();
    },
    toggleFullscreen: () => {
      if (videoRef.current.requestFullscreen) {
        videoRef.current.requestFullscreen();
      } else if (videoRef.current.webkitRequestFullscreen) { /* Safari */
        videoRef.current.webkitRequestFullscreen();
      } else if (videoRef.current.msRequestFullscreen) { /* IE11 */
        videoRef.current.msRequestFullscreen();
      }
    },
  }));

  return (
    <video ref={videoRef} width="400" controls>
      <source src="https://www.w3schools.com/html/mov_bbb.mp4" type="video/mp4" />
      Your browser does not support HTML5 video.
    </video>
  );
}

const ForwardedVideoPlayer = React.forwardRef(VideoPlayer);

function App() {
  const videoRef = React.useRef();

  return (
    <div>
      <ForwardedVideoPlayer ref={videoRef} />
      <div>
        <button onClick={() => videoRef.current.play()}>Play</button>
        <button onClick={() => videoRef.current.pause()}>Pause</button>
        <button onClick={() => videoRef.current.toggleFullscreen()}>
          Fullscreen
        </button>
      </div>
    </div>
  );
}

render(<App />);
